/**
 * Верное решение, но не оптимальное
 * @param {number[][]} events
 * @return {number}
 */
const maxTwoEvents = function (events) {
  let leftPointer = 0;
  let rightPointer = 1;

  const result = [];

  while (leftPointer < events.length) {
    if (!events[rightPointer]) {
      break;
    }

    const [startLeft, endLeft, valueLeft] = events[leftPointer];
    const [startRight, endRight, valueRight] = events[rightPointer];
    result[valueLeft] = true;
    result[valueRight] = true;

    if (endLeft < startRight || startLeft > endRight) {
      result[valueLeft + valueRight] = true;
    }

    if (rightPointer === events.length - 1) {
      leftPointer++;
      rightPointer = leftPointer + 1;
    } else {
      rightPointer++;
    }
  }

  return result.length - 1;
};

/**
 * Верное решение и оптимальное
 * @param {number[][]} events
 * @return {number}
 */
const maxTwoEvents2 = function (events) {
  // Создаем копию событий, отсортированную по времени окончания
  const endEvents = [...events];
  endEvents.sort((a, b) => a[1] - b[1]);

  // Сортируем оригинальный массив событий по времени начала
  events.sort((a, b) => a[0] - b[0]);

  // Инициализируем переменные
  let previousValue = 0; // Максимальное значение предыдущих событий
  let result = 0; // Максимальная сумма двух событий
  let currentEnd = 0; // Текущий индекс события, отсортированного по окончанию

  // Проходим по событиям, отсортированным по времени начала
  for (let index = 0; index < events.length; index++) {
    const [start, end, value] = events[index];

    // Находим максимальное значение событий, которые закончились до текущего начала
    while (currentEnd < endEvents.length && endEvents[currentEnd][1] < start) {
      const endValue = endEvents[currentEnd][2];

      // Обновляем максимальное значение предыдущих событий
      previousValue = Math.max(endValue, previousValue);
      currentEnd++;
    }

    // Обновляем максимальный результат
    result = Math.max(previousValue + value, result);
  }

  return result;
};

